INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 133801, 0.0, -285.0, 10201, "2030/01/01 14:59:59", 61, "2025/01/31 12:00:00", 6, 1, 15.5, "ネネカ", 1020103, 301);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 134301, 0.0, -285.0, 10202, "2030/01/01 14:59:59", 61, "2025/02/28 12:00:00", 2, 5, 9.061, "ランファ", 1020201, 101);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 134401, 0.0, -285.0, 10202, "2030/01/01 14:59:59", 61, "2025/02/28 12:00:00", 1, 2, 7.699, "チカ", 1020202, 201);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 134601, 0.0, -285.0, 10203, "2030/01/01 14:59:59", 61, "2025/03/31 12:00:00", 1, 2, 8.595, "アオイ", 1020301, 101);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 134501, 0.0, -285.0, 10203, "2030/01/01 14:59:59", 61, "2025/03/31 12:00:00", 1, 2, 7.758, "クローチェ", 1020302, 201);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 132302, 0.0, -285.0, 10204, "2030/01/01 14:59:59", 61, "2025/04/30 12:00:00", 2, 6, 7.0, "ルイズマリー", 1020401, 101);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 132402, 0.0, -285.0, 10204, "2030/01/01 14:59:59", 61, "2025/04/30 12:00:00", 1, 2, 7.904, "イロハ", 1020402, 201);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 132502, 0.0, -285.0, 10204, "2030/01/01 14:59:59", 61, "2025/04/30 12:00:00", 4, 2, 8.487, "ソノ", 1020403, 301);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 134901, 0.0, -285.0, 10205, "2030/01/01 14:59:59", 61, "2025/05/31 12:00:00", 1, 2, 8.763, "カノン", 1020502, 101);
